pragma solidity >=0.4.21 <0.6.0;

import "./ERC721Full.sol";

contract Color is ERC721Full {
  string public name;
  uint public chicks = 0;
  mapping(uint => Farmer) public farmers;

  constructor() ERC721Full("CryptoChickens", "MEMORY") public {
  }

  struct Farmer {
    uint id;
    string name;
    uint coins;
    uint transactions;
    address payable owner;
  }

  event FarmerBorn(
    uint id,
    string name,
    uint coins,
    uint transactions,
    address payable owner
  );

  event CoinsBought(
    uint id,
    string name,
    uint coins,
    uint transactions,
    address payable owner
  );

  function makeFarmer() public {
    chicks++;
    farmers[chicks] = Farmer(chicks, "Pablo", 80, 0, msg.sender);
    emit FarmerBorn(chicks, "Pablo", 80, 0, msg.sender);
  }

  function buyCoins(uint _id) public payable {
    // Grab the Feline
    Farmer storage _farmer = farmers[_id];
    address payable _owner = _farmer.owner;
    address(_owner).transfer(msg.value);
    _farmer.coins = _farmer.coins + 1000;
    uint transactions = _farmer.transactions++;
    emit CoinsBought(_id, _farmer.name, _farmer.coins, transactions, _farmer.owner);
  }

  function mint(address _to, string memory _tokenURI) public returns(bool) {
    uint _tokenId = totalSupply().add(1);
    _mint(_to, _tokenId);
    _setTokenURI(_tokenId, _tokenURI);
    return true;
  }

  function breedermint(address _to, string memory _tokenURI) public payable returns(bool) {
    address payable _owner = msg.sender;
    address(_owner).transfer(msg.value);
    uint _tokenId = totalSupply().add(1);
    _mint(_to, _tokenId);
    _setTokenURI(_tokenId, _tokenURI);
    return true;
  }

}
